import React from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

export default class HomeMap extends React.Component{

    componentDidMount(){
        this.map = L.map('map', {
            center: [58, 16],
            zoom: 6,
            zoomControl: false

        });
    }


}
